message:
*PRODUTORES RURAIS podem virar o resultado e eleger BOLSONARO!* 

Metade dos 32 milhões de abstenção (16 mi) estão em áreas rurais, não conseguiram votar por motivos:
- Distância das cidades, trasporte (R$);
- Trabalho (maternidade, inseminação, plantio, embarque, confinamentos, frangos, suínos, leiterias....)

Produtores rurais podemos ajudar no transporte, otimizar esse operacional de trabalho liberando de algum jeito nossos eleitores que não votaram p fazer a diferença no 2° turno.

> Frigoríficos cancelar embarque no domingo, liberar caminhoneiros e vaqueiros p votar;

> Confinamentos reduzir 1 trato, trocar turno, revezar equipe p todos votarem;

> Agricultura plantar sábado e segunda liberar funcionários p votar no domingo;

> Suínos e Aves, cancelar embarques domingo (adiar ou antecipar), otimizar trabalho de trato, trocar turno revezar gente, etc.

A conta é simples e clara = 1 dia de prejuízo p 4 ou 8 anos de LUCRO em todos os setores (economia, educação, saúde, segurança...)
PASSEM ISTO  PARA  AMIGOS FAZENDEIROS, TODOS  QUE TRABALHAM NA PRODUÇÃO AGRÍCOLA

A omissão de 40 milhões de apátridas pode custar a liberdade de 220 milhões de brasileiros. VÁ VOTAR!!! CONVENÇA OUTROS A IREM TAMBÉM!!!

Canal
@OsPatriotas🇧🇷
